import React from "react";
import { Link } from "react-router-dom";
import classes from "../styles/Videos.module.css";
import Vedio from "./Vedio";
const Vedios = () => {
  return (
    <div className={classes.videos}>
      <Link to="quiz">
        <Vedio />{" "}
      </Link>
      <Link to="quiz">
        <Vedio />{" "}
      </Link>
      <Link to="quiz">
        <Vedio />{" "}
      </Link>
      <Link to="quiz">
        <Vedio />{" "}
      </Link>
      <Link to="quiz">
        <Vedio />{" "}
      </Link>
    </div>
  );
};

export default Vedios;
